import axios from "axios";

function Axiosed(){

const options = {
    url: 'https://viacep.com.br/ws/01001000/json/',
    method:'GET',
    headers:{
        'Accept': 'application/json',
        'Content-type': 'application/json;charset=UTF-8'

    },

    params:{
        a:10,
        b:20
    }
}

axios(options)
    .then(response=>{
        console.log(response.data)
    })

}

export default Axiosed;
